import React from "react";
import {
  createMuiTheme,
  makeStyles,
  ThemeProvider,
} from "@material-ui/core/styles";
import Header from "./components/Header";
import PokemonsList from "./components/PokemonsList";

const styles = makeStyles((theme) => ({
  bodyContainer: {
    marginTop: 90,
    marginRight: "25%",
    marginLeft: "25%",
  },
}));

const theme = createMuiTheme({
  palette: {
    primary: {
      light: "#ff3d00",
      main: "#ff3d00",
      dark: "#002884",
      contrastText: "#fff",
    },
    secondary: {
      light: "#ff7961",
      main: "#f44336",
      dark: "#ba000d",
      contrastText: "#000",
    },
  },
});

const App = () => {
  const classes = styles();

  return (
    <ThemeProvider theme={theme}>
      <Header />
      <div className={classes.bodyContainer}>
        <PokemonsList />
      </div>
    </ThemeProvider>
  );
};

export default App;
